card.passive_skill_desc:
ATK & DEF +150%; reduces damage received by 10%; 
plus an additional damage reduction of 10% within 
the same turn with each attack received (up to 30%); 
Ki +1 with each attack performed (up to +5); 
medium chance of launching an additional Super Attack; 
if HP is 50% or less at start of character's attacking turn 
after the character receives an attack 7 or more times in battle, 
revives with 70% HP recovered when the character or 
an ally attacking in the same turn is KO'd (once only)

